import React from 'react';
import './Student.css';

const Student = () => {
    return (
        <div className="student-container">
            <h1>Student Dashboard</h1>
            <div className="student-content">
                <div className="student-section">
                    <h2>My Courses</h2>
                    <button className="student-btn">View Enrolled Courses</button>
                    <button className="student-btn">Browse Available Courses</button>
                    <button className="student-btn">Course Progress</button>
                </div>
                <div className="student-section">
                    <h2>Assignments</h2>
                    <button className="student-btn">View Assignments</button>
                    <button className="student-btn">Submit Assignment</button>
                    <button className="student-btn">View Grades</button>
                </div>
                <div className="student-section">
                    <h2>Resources</h2>
                    <button className="student-btn">Course Materials</button>
                    <button className="student-btn">Announcements</button>
                    <button className="student-btn">Help Center</button>
                </div>
            </div>
        </div>
    );
};

export default Student;
